Jury panel was lined up in the hallway when parties advised the Court that they reached a settlement.  Defense counsel indicated that  defendant wished to plead guilty.  Pursuant to negotiations, the State moved to dismiss but read in Count 2.  Court granted State's motion and ordered Count 2 dismissed but read in.

AS TO COUNT 01:
Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms or body armor.  Court further advised defendant of voting ineligibility.  Court passed case to release jury panel.   

Sentencing proceeded.  Statements by the State, defense and defendant.  Victims both present in court, but do not wish to make a statement. The Court imposed the following sentence:   The Defendant's TOTAL LENGTH OF SENTENCE shall be 12 years consecutive to any other sentence.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 7 years.  Defendant shall serve 5 years on EXTENDED SUPERVISION.  The defendant is not eligible for the Challenge Incarceration Program or  the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 
 * DNA sample previously provided, so it was not ordered again.
 * Court ordered defendant to pay restitution to the victims in the stipulated amounts as follows:  $126.00 to Simera S. and $44.00 to Quintrell B. first; then pay the DNA surcharge, costs and disbursements.  Court ordered all monies be taken by the Department of Corrections from prison funds not to exceed 25%.  Balance to be paid while on Extended Supervision.  

CONDITIONS OF EXTENDED SUPERVISION:
 - Undergo a mental health evaluation; follow any treatment recommended;
 - No controlled substances other than those legally prescribed for defendant by a duly licensed physician for his mental or physical needs; take only as prescribed and for only as long as deemed medically reasonable and necessary;
 - No alcohol;
 - AODA assessment; treatment, if needed;
 - Urine screens;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Pay the DNA surcharge, costs and disbursements by the end of probationary period.  Should defendant get revoked and be sent to prison, Court ordered monies taken by the Department of Correction from up to 25% of prison funds.  Balance would be then be paid while on Extended Supervision.   Failure to pay amounts in full would result in a civil judgment entered against defendant.

Filed,
Victim Impact Statements (2) and Restitution Worksheets (2);
Ineligible Voting Notice & Acknowledgement;
Written Explanation of Determinate Sentence;
Notice of Right to Seek Postconviction Relief.

